<script type='text/tonyu' data-filename='.desktop'  data-wrap='80'>{"runMenuOrd":["Main","Ball"]}

<script type='text/tonyu' data-filename='Ball.tonyu'  data-wrap='80'>
while (y<$screenHeight) {
    y+=3;
    update();
}
die();

</script>

<script type='text/tonyu' data-filename='Main.tonyu'  data-main='true' data-wrap='80'>
native dumpScript;
t=0;
while(true) {
    if (t%5==0) {
        new Ball{x:rnd($screenWidth),y:0, p:$pat_balls+rnd(25)};
    }
    t++;
    if (getkey("U")) break;
    update();
}
dumpScript();
</script>
